// src/pages/IntroPage.js
import React from 'react';
import HistogramChart from '../components/HistogramChart';

const IntroPage = () => {
  return (
    <div style={{ padding: '1rem' }}>
      <h1>Project Report Introduction</h1>
      <p>
        This website showcases our algorithms for maximal clique enumeration with interactive histograms
        displaying cliques distribution and time analysis.
      </p>
      
      <h2>Cliques Distribution Histograms</h2>
      <HistogramChart title="Algorithm 1: Cliques Distribution" />
      <HistogramChart title="Algorithm 2: Cliques Distribution" />
      <HistogramChart title="Algorithm 3: Cliques Distribution" />
      
      <h2>Time Analysis Histograms</h2>
      <HistogramChart title="Algorithm 1: Time Analysis" />
      <HistogramChart title="Algorithm 2: Time Analysis" />
      <HistogramChart title="Algorithm 3: Time Analysis" />
    </div>
  );
};

export default IntroPage;
